import React from 'react';
import './Navigation.css';
import cross from '../../images/cross.svg';

const Navigation = () => {
    return (
        
        <section className="menu menu_active">
            <div className="menu__container">
                <nav className="menu__links">
                    <button className="menu__close"><img className="menu__img" src={cross}/></button>
                    <li className="menu__item"><a className="menu__link" href="#">Главная</a></li>
                    <li className="menu__item"><a className="menu__link" href="#">Фильмы</a></li>
                    <li className="menu__item"><a className="menu__link" href="#">Сохраненные фильмы</a></li>
                </nav>
                <button className="menu__button">Аккаунт</button>
            </div>
        </section>
    );
};

export default Navigation;
